  templateUrl: './produto-tabela.component.html',
  styleUrls: ['./produto-tabela.component.scss']
})
export class ProdutoTabelaComponent implements OnInit {

  produtos : ProdutoDTO[] = [];

  constructor(){}
  ngOnInit(): void {
    this.produtos = [
      {id:1, descricao}
